import React from "react";
import './App.css';

const App = () => {
    return (
        <div className='app-wrapper'>
            <header>
                <img src='https://upload.wikimedia.org/wikipedia/commons/7/7e/Falanster_logo_300x300.png'/>
            </header>
            <nav>
                <div> Profile</div>
                <div> Message</div>
            </nav>
            <div> Main Content</div>
        </div>
    );
}

export default App;
